import React from 'react';
import { NavLink } from 'react-router-dom';
import { connect } from 'react-redux';

import LinkItem from '../components/LinkItem/LinkItem'

import styles from './DefaultPage.module.css'


function render(props) {
	return (
		<div className={styles.page}>
			<ul className={styles.list}>
				{Object.keys(props.departments).map(id => 
					<NavLink to={`department/${id}/doctor`} >
						<LinkItem
							key={id}
							index={id}
							text={props.departments[id]['name']} />
					</NavLink>)}
			</ul>
		</div>
	);
};


const mapStateToProps = state => {console.log(state); return {departments: state.schedule.schedule.departments}};

export { render };

export default connect(mapStateToProps)(render);
